"iud_config_info_text" : "{bold_header_brand}

Cuando selecciones una marca específica, el campo de tiempo de efectividad se rellenará previamente basándose en los estudios clínicos de ese dispositivo. Si tu DIU no está en la lista, selecciona Otro DIU hormonal u Otro DIU de cobre según el tipo que tengas.

{bold_header_hormonal_copper}

Los DIUs hormonales liberan la hormona progestina para prevenir el embarazo. Funciona haciendo el flujo cervical más espeso, y con ello dificultando el movimiento y la supervivencia de los espermatozoides, y adelgazando el revestimiento uterino.

Los DIUs de cobre modifican el entorno del útero y el flujo cervical al liberar cobre libre y sales de cobre en el útero. Este cambio dificulta el movimiento y la supervivencia de los espermatozoides.

{bold_header_time_effective}

Cuando respondas a la pregunta “¿Por cuánto tiempo es efectivo?” Por favor, utiliza el número total de años que tu DIU es efectivo (para prevenir el embarazo). Esta información se utilizará para mostrar una cuenta regresiva en tu página de Seguimiento de la Salud que te recordará cuándo tendrás que retirarlo o reemplazarlo. En función de la marca seleccionada, este campo se completará con el número de años en que se ha demostrado su eficacia para prevenir el embarazo en los ensayos clínicos. Si has recibido una información diferente de tu proveedor de atención médica, no dudes en ajustar el número de años para que coincida.

{bold_header_date_insertion}

Esta es la fecha en la que se te colocó el DIU y es necesaria para calcular su durabilidad recomendada. Esta fecha también tendrá un icono para indicar que es la fecha de inserción en tu Calendario. Aunque te recomendamos que introduzcas la fecha exacta, no pasa nada si te retrasas unos días porque los dispositivos son muy duraderos."

"extended_cycle_pill_config_info_text" : "{bold_header_how_many_pills}

Las píldoras de ciclo extendido pueden venir en diferentes tamaños de paquetes, aunque el más común es de 13 semanas (91 días).

{bold_header_active_pills}

Son píldoras que contienen hormonas. Las píldoras activas conforman la mayoría, o la totalidad de un paquete. Lo más común para un paquete de 13 semanas es que haya 84 o 91 píldoras activas.

{bold_header_placebos}

Los placebos (también conocidos como píldoras recordatorias) son píldoras que no contienen hormonas. Dependiendo de tu paquete, puedes tomar placebos o no tomar píldoras en determinados días, normalmente entre paquetes. Algunos paquetes de ciclo extendido tienen hormonas en cada píldora en diferentes dosis, así que si no estás segura de si tienes o no placebos, simplemente introduce el número total de píldoras como píldoras activas e introduce 0 en el campo de placebos/sin píldoras.

{bold_header_where_in_current_pack}

Esta es la semana y el día en que te encuentras en tu paquete actual, comenzando con la primera pastilla como Semana 1, Día 1.

Si necesitas cambiarlo más tarde, puedes actualizarlo en tu Calendario de Ovia y en la página de Seguimiento de la Salud.

{bold_header_brand}

Este es un campo opcional para quienes les gustaría darle seguimiento a cualquier cambio en los síntomas y efectos secundarios al cambiar de marca."

"implant_config_info_text" : "{bold_header_date_insertion}

This is the date you had your implant inserted and is needed to calculate how much longer it’s effective for. Ovia considers implants effective for 3 years total, based on clinical studies. This date will also have an icon to indicate it as the insertion date on your Calendar. While we recommend you enter the precise date, being a few days off should be okay because the devices are so long-lasting.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

"iud_config_info_text" : "{bold_header_brand}

When you select a specific brand, the time effective field will pre-fill based on the clinical studies of that device. If your IUD isn't on the list, select either “Other hormonal IUD” or “Other copper IUD” depending on which type you have.

{bold_header_hormonal_copper}

Hormonal IUDs release the hormone progestin to prevent pregnancy. It works by thickening cervical fluid, making it difficult for sperm to move and survive, and thinning the uterine lining.

Copper IUDs change the uterine environment and cervical fluid by releasing free copper and copper salts into the uterus. This change makes it difficult for sperm to move and survive.

{bold_header_time_effective}

When answering “How long is it effective for?” please use the total number of years that your IUD is effective for (at preventing pregnancy). This info will be used to display a countdown on your Health Tracking page reminding you when you’ll need to remove or replace it. Based on your selected brand, this field will pre-fill with the number of years it has been proven effective at preventing pregnancy in clinical trials. If you have received different information from your healthcare provider, feel free to adjust the number of years.

{bold_header_date_insertion}

This is the date you had your IUD inserted and is needed to calculate how much longer it’s effective for. This date will also have an icon to indicate it as the insertion date on your Calendar. While we highly recommend you enter the precise date, being a few days off should be okay because the devices are so long-lasting."

"ring_config_info_text" : "{bold_header_ring_free}

This is the number of days each month you do not have a ring inserted. It’s used on the Health Tracking page to display when it’s time for a new ring.

Typical use of most rings is to have a ring inserted for 3 weeks, go ring-free for a week (7 days), then insert a new ring. If this is how you use the ring, then your ring-free interval is 7 days.

Some take shorter ring-free intervals, which can help alleviate period symptoms, or even reduce or eliminate monthly bleeding. Others use the ring continuously, taking no time ring-free and simply removing the old ring and inserting a new one every 3 weeks. Please speak with your healthcare provider about shorter ring-free intervals or continuous use of the ring to make sure it’s safe and right for you.

*Note: the ring-free interval cannot be longer than 7 days. Longer than this the ring hormones will be lower, leaving you unprotected against pregnancy.

{bold_header_date_insertion_removal}

This is the date on which you inserted the ring you currently have in or the date you removed your last ring (if you're currently ring-free). This is used for a counter on the Health Tracking page to remind you when a ring should be removed or a new one inserted.

If you need to change it later, you can update it in your Ovia Calendar and Health Tracking page.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

