"minipill_config_info_text" : "{bold_header_how_many_pills}

Minipills come in packs of 28 pills, which is 4 weeks worth. If you have a different quantity of pills, please check the information that came with your prescription to verify that you are taking a progestin-only hormonal oral contraceptive. If you have a rare type of minipill that comes in a different pack size, you will still be able to log it in Ovia, though the reminders for when to start a new pack are based on the standard 4-week pack size.

{bold_header_where_in_current_pack}

This is the week and day you're on in your current pack, starting with the first pill as Week 1, Day 1, and the final pill as Week 4, Day 7.

If you need to change it later, you can update it in your Ovia Calendar and Health Tracking page.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

"combo_pill_config_info_text" : "{bold_header_how_many_pills}

Las píldoras combinadas pueden venir en paquetes de diferentes tamaños, aunque el más común es el de 4 semanas (28 días). Algunos paquetes pueden tener píldoras para 3 semanas con un descanso de 7 días entre paquetes.

{bold_header_active_pills}

Estas píldoras contienen hormonas. La mayor parte del paquete es de píldoras activas. Lo más común para un paquete de 4 semanas es 3 semanas (21 días) de píldoras activas.

{bold_header_placebos}

Los placebos (también conocidos como píldoras recordatorias) son pastillas que no contienen hormonas. La mayoría de los paquetes de 4 semanas contienen 1 semana (7 días) de placebos. Si tienes paquetes de 3 semanas, probablemente pasarás 7 días sin pastillas entre paquetes. Algunos paquetes tienen hormonas en diferentes dosis en cada píldora, por lo que si no estás segura de si tienes pastillas con placebos o no, solo ingresa tu número total de pastillas como píldoras activas e introduce 0 en el campo de placebos/sin pastillas.

{bold_header_where_in_current_pack}

Esta es la semana y el día en que estás en tu paquete actual, empezando con la primera píldora como la Semana 1, Día 1.

Si necesitas cambiarla más adelante, puedes actualizarla en tu Calendario Ovia y en la página de Seguimiento de la Salud.

{bold_header_brand}

Este es un campo opcional para quienes les gustaría darle seguimiento a cualquier cambio en los síntomas y efectos secundarios al cambiar de marca."

"combo_pill_config_info_text" : "{bold_header_how_many_pills}

Combination pills can come in different pack sizes, though the most common is 4 weeks (28 days). Some packs may have 3 weeks of pills with a 7-day break between packs.

{bold_header_active_pills}

These are pills containing hormones. Active pills make up the majority of a pack. The most common for a 4-week pack is 3 weeks (21 days) of active pills.

{bold_header_placebos}

Placebos (also known as reminder pills) are pills that contain no hormones. Most 4-week packs contain 1 week (7 days) of placebos. If you have 3-week packs, you'll probably go pill-free for 7 days between packs. Some packs have hormones in every pill at different dosages, so if you are uncertain whether or not you have placebos, just enter your total number of pills as active pills and enter 0 for the placebos/pill-free field.

{bold_header_where_in_current_pack}

This is the week and day you're on in your current pack, starting with the first pill as Week 1, Day 1.

If you need to change it later, you can update it in your Ovia Calendar and Health Tracking page.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

"care_manager_pop_over_text" : "{bold_pattern}
If you have a care manager assigned to you from your health plan, you can view your conversations with them here. Care managers are representatives of your health plan, not Ovia, even when they are using the Ovia app to communicate with you. Learn more about Care Managers

"

"minipill_config_info_text" : "{bold_header_how_many_pills}

Las mini píldoras vienen en paquetes de 28 pastillas, lo que equivale a 4 semanas. Si tienes una cantidad diferente de pastillas, revisa la información que viene con tu receta para verificar que estás tomando un anticonceptivo oral hormonal sólo de progestina. Si tienes un tipo de mini píldora que viene en un paquete de tamaño diferente, todavía podrás registrarlo en Ovia, aunque los recordatorios de cuándo empezar un nuevo paquete se basan en el tamaño de envase estándar de 4 semanas.

{bold_header_where_in_current_pack}

Esta es la semana y el día en que te encuentras en tu paquete actual, comenzando con la primera píldora como Semana 1, Día 1, y la última píldora como Semana 4, Día 7.

Si necesitas cambiarla más tarde, puedes actualizarla en tu Calendario de Ovia y en la página de Seguimiento de la Salud.

{bold_header_brand}

Este es un campo opcional para quienes les gustaría darle seguimiento a cualquier cambio en los síntomas y efectos secundarios al cambiar de marca."

"patch_config_info_text" : "{bold_header_patch_free}

This is the number of days each month you do not have a patch applied. It’s used on the Health Tracking page to display when it’s time for a new patch.

Typical use of the patch is applying a new one each week for 3 weeks, going patch-free for a week (7 days), then applying a new patch to a new location on the body. If this is how you use the patch, then your patch-free interval is 7 days.

Some choose to take shorter patch-free intervals, which can help alleviate period symptoms, or even reduce or eliminate monthly bleeding. Others use the patch continuously, taking no time patch-free and simply applying a new patch each week to a new location on the body. Please speak with your healthcare provider about shorter patch-free intervals or continuous use of the patch to make sure it’s safe and right for you.

Please note that, in most cases, the patch-free interval should not be longer than 7 days. Any longer than this, and you may not be protected against pregnancy.

{bold_header_date_application}

This is the date on which you applied the patch you currently have on, or the date you removed your last patch (if you're currently patch-free). This is used for a counter on the Health Tracking page to remind you when a patch should be removed or a new one applied. If you need to change it later, you can update it in your Ovia Calendar and Health Tracking page.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

"shot_config_info_text" : "{bold_header_date_injection}

This is the date you had your last shot inserted and is needed to calculate when you'll need your next one. For counting down to your next shot, Ovia uses the standard interval for most birth control shots: every 12 weeks (3 months). This date will also show a shot icon on your Calendar. We highly recommend you enter the precise date. If you only remember the week or month your shot’s effectiveness may wear off and you will lose your protection against pregnancy. When you are uncertain about timing, it is important to use backup (non-hormonal) birth control methods, like condoms, if you wish to avoid pregnancy.

{bold_header_brand}

This is an optional field for those who would like to track any changes in symptoms and side effects while switching brands."

